import { useState, useEffect } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import { 
  fetchProposals,
  acceptProposalAndUpdateProperty,
  rejectProposal,
  fetchProperty
} from '../../services/api';

const PropertyProposals = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [proposals, setProposals] = useState([]);
  const [property, setProperty] = useState(null);
  const [loading, setLoading] = useState(true);
  const [message, setMessage] = useState({ text: '', type: '' });
  const [selectedProposal, setSelectedProposal] = useState(null);

  useEffect(() => {
    const loadData = async () => {
      try {
        setLoading(true);
        const [proposalsData, propertyData] = await Promise.all([
          fetchProposals(id),
          fetchProperty(id)
        ]);
        setProposals(proposalsData.data);
        setProperty(propertyData.data);
      } catch (error) {
        setMessage({
          text: error.response?.data?.message || 'Failed to load proposals',
          type: 'error'
        });
      } finally {
        setLoading(false);
      }
    };

    loadData();
  }, [id]);

  const handleAccept = async (proposalId) => {
    try {
      await acceptProposalAndUpdateProperty(proposalId);
      setProposals(proposals.filter(p => p._id !== proposalId));
      setMessage({
        text: 'Proposal accepted and property marked as rented',
        type: 'success'
      });
      const updatedProperty = await fetchProperty(id);
      setProperty(updatedProperty.data);
    } catch (error) {
      setMessage({
        text: error.response?.data?.message || 'Failed to accept proposal',
        type: 'error'
      });
    }
  };

  const handleReject = async (proposalId) => {
    try {
      await rejectProposal(proposalId);
      setProposals(proposals.filter(p => p._id !== proposalId));
      setMessage({
        text: 'Proposal rejected successfully',
        type: 'success'
      });
    } catch (error) {
      setMessage({
        text: error.response?.data?.message || 'Failed to reject proposal',
        type: 'error'
      });
    }
  };

  const viewTenantProfile = (tenantId) => {
    navigate(`/admin/tenants/${tenantId}`);
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>Loading proposals...</p>
      </div>
    );
  }

  return (
    <div className="property-proposals-container">
      <div className="header-section">
        <Link to="/landlord/properties" className="back-link">
          &larr; Back to Properties
        </Link>
        <h1>Rental Proposals Management</h1>
      </div>

      {property && (
        <div className="property-info-card">
          <div className="property-header">
            <h2>{property.title}</h2>
            <span className={`status-badge ${property.status}`}>
              {property.status.toUpperCase()}
            </span>
          </div>
          <div className="property-details">
            <p><strong>Location:</strong> {property.location}</p>
            <p><strong>Price:</strong> ${property.price}/month</p>
            <p><strong>Views:</strong> {property.viewCount}</p>
          </div>
        </div>
      )}

      {message.text && (
        <div className={`alert-message ${message.type}`}>
          {message.text}
        </div>
      )}

      <div className="proposals-section">
        <h2>Received Proposals ({proposals.length})</h2>
        
        {proposals.length > 0 ? (
          <div className="proposals-grid">
            {proposals.map(proposal => (
              <div 
                key={proposal._id} 
                className={`proposal-card ${selectedProposal === proposal._id ? 'selected' : ''}`}
                onClick={() => setSelectedProposal(proposal._id)}
              >
                <div className="proposal-header">
                  <div className="tenant-info">
                    <img 
                      src={proposal.tenant.avatar || '/images/default-avatar.png'} 
                      alt={proposal.tenant.name}
                      className="tenant-avatar"
                    />
                    <div>
                      <h3>{proposal.tenant.name}</h3>
                      <p className="application-date">
                        Applied: {new Date(proposal.createdAt).toLocaleDateString()}
                      </p>
                    </div>
                  </div>
                  <button 
                    onClick={(e) => {
                      e.stopPropagation();
                      viewTenantProfile(proposal.tenant._id);
                    }}
                    className="view-profile-btn"
                  >
                    View Profile
                  </button>
                </div>

                <div className="proposal-content">
                  <div className="proposal-message">
                    <h4>Message:</h4>
                    <p>{proposal.message || 'No message provided'}</p>
                  </div>

                  {proposal.documents?.length > 0 && (
                    <div className="documents-section">
                      <h4>Attached Documents:</h4>
                      <div className="documents-list">
                        {proposal.documents.map((doc, index) => (
                          <a
                            key={index}
                            href={`/uploads/${doc}`}
                            target="_blank"
                            rel="noopener noreferrer"
                            className="document-link"
                          >
                            Document {index + 1}
                          </a>
                        ))}
                      </div>
                    </div>
                  )}
                </div>

                <div className="proposal-actions">
                  <button
                    onClick={(e) => {
                      e.stopPropagation();
                      handleAccept(proposal._id);
                    }}
                    className="accept-btn"
                  >
                    Accept & Rent
                  </button>
                  <button
                    onClick={(e) => {
                      e.stopPropagation();
                      handleReject(proposal._id);
                    }}
                    className="reject-btn"
                  >
                    Reject
                  </button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="no-proposals">
            <img src="/images/no-proposals.svg" alt="No proposals" />
            <h3>No proposals received yet</h3>
            <p>When tenants apply to rent this property, their proposals will appear here.</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default PropertyProposals;
